import React, { useState , useEffect } from 'react'

import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Find from './Pages/Find';
import Serv from './Pages/Serv';
import HowWeWork from './Pages/HowWeWork';
import Register from './components/Register/Register';
import Login from './components/logins/';
// import LoginSignup from './Pages/LoginSignup';
import LandingPage from './components/LandingPage/LandingPage'; // Corrected path

import { BrowserRouter as Router, Routes, Route, BrowserRouter } from "react-router-dom";
import Res from './Pages/Ressources';

function App() {
  let path = (window.location.pathname);
    return (
      <>
     <BrowserRouter>
      <Header />
      <Routes>
      <Route path="/login" exact component={Login} />
				<Route path="/register" exact component={Register} />
				{/* <Route path="/dashboard" exact component={Dashboard} /> */}
        <Route path="/" element={<LandingPage />} /> 
        {/* // protected rout */}
        <Route path="/Home" element={<LandingPage />} />
        <Route path="/Find" element={<Find />} />
        <Route path="/Serv" element={<Serv />} />
        <Route path="/Ressources" element={<Res />} />
        <Route path="/Work" element={<HowWeWork />} />
        {/* <Route path="/login" element={<LoginSignup />} /> */}
      </Routes>
      <Footer />
    </BrowserRouter>
    </>
  )
}

export default App;
